import React, { Component } from 'react';

class Home extends Component {
    constructor(props){
        super(props);
        this.user = props.userName;
        this.display = '';
    }
    render() {
        return (
            <div className="App">
                <h1>Project Home</h1>
            </div>
        )
    }
}

export default Home;
